import React from "react";
import { useNavigate } from 'react-router-dom';


export const UpdateProfile = () => {
  const navigate = useNavigate();

  const handleHomeClick = () => {
    // Navigate to the home route ("/")
    navigate('/');
  };

  const handleRegisterClick = () => {
    // Navigate to the route ("/register")
    navigate('/register');
  };

  return (
    <div className="desktop">
      <div className="fram">
        <div className="overlap-grouph">
          {/* ... previous content ... */}
          
          {/* New utilities */}
          <div className="upload-image">
            <h2>Upload Image</h2>
            <input type="file" accept="image/*" />
            <div>
              <label htmlFor="idNumber">ID Number:</label>
              <input type="text" id="idNumber" name="idNumber" />
            </div>
            <div>
              <label htmlFor="fullNames">Full Names:</label>
              <input type="text" id="fullNames" name="fullNames" />
            </div>
            <div>
              <label htmlFor="relationship">Relationship to Deceased:</label>
              <input type="text" id="relationship" name="relationship" />
            </div>
            <div>
              <label htmlFor="biology">Biology:</label>
              <input type="text" id="biology" name="biology" />
            </div>
            <div>
              
            </div>
          </div>
          
          {/* ... remaining content ... */}
        </div>
      </div>
    </div>
  );
};

export default UpdateProfile;
